        <script src="https://www.goinstablog.com/goinstablog.com/sumitdesign/design/digibids.com/common/plugins/jquery-simple-datetimepicker/jquery.simple-dtpicker.js"></script>
        <script src="https://www.goinstablog.com/goinstablog.com/sumitdesign/design/digibids.com/common/plugins/pickerjs/picker.min.js"></script>
        <script src="https://www.goinstablog.com/goinstablog.com/sumitdesign/design/digibids.com/common/plugins/rating/jquery.rating-stars.js"></script>
